tables.table_schema:
CREATE TABLE land_use_data (
    id INT PRIMARY KEY,
    region VARCHAR(255),
    land_type VARCHAR(255),
    land_area DECIMAL
);

CREATE TABLE LandUseData (
  id INT PRIMARY KEY,
  land_type VARCHAR(255),
  land_area FLOAT,
  year INT
);

CREATE TABLE ZoningRegulations (
  zoning_id INT PRIMARY KEY,
  zone_type VARCHAR(255),
  height_limit FLOAT,
  floor_area_ratio FLOAT
);
